import { Button, Input } from "antd";

function Signin() {
  return (
    <div id="wrapper">
      <div className="pane">Getch</div>
      <div className="auth">
        <div className="details">
          <p>Sign in</p>
          <div className="input">
            <Input placeholder="email" />
          </div>
          <div className="input">
            <Input placeholder="password" />
          </div>
          <Button primary/>
        </div>
      </div>
      <style jsx>{`
        #wrapper {
          display: flex;
          width: 100%;
          height: 100vh;
        }

        .pane {
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          background-color: #281742;
          flex: 1;
        }

        .auth {
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          flex: 2;
        }

        .details {
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          width: 40%;
        }

        .input {
          width: 100%;
          margin: 10px 0 10px 0;
        }

        .card {
          color: black;
          display: flex;
          border-radius: 4px;
          width: 30%;
          background-color: white;
          height: 100px;
        }
      `}</style>
    </div>
  );
}

Signin.Layout = (props) => <div>{props.children}</div>;

export default Signin;
